import styled from "styled-components";

export const components = styled.div`
.memo{
    color: #fff;
    display: flex;
    justify-content: center;
   
}
    .background{
         border-radius: 32px 32px 0px 0px;
    background-color: #bcb8b1;
    min-width: 50%;
    
    height: auto;
    }
`
